    mMatrix2 = mat4.rotate(mMatrix2, Z_angle2 * Math.PI / 180, [0, 1, 0]);   // now set up the model matrix
    mMatrix3 = mat4.rotate(mMatrix3, Z_angle3 * Math.PI / 180, [0, 1, 0]);   // now set up the model matrix
